def user_function(xfaas_object) -> SerWOObject:
  try:
    logging.info("We are in the fn")
    body=xfaas_object.get_body()
    # logging.info("Body:"+json.dumps(body))
    subexp_list = objectify(body["circuits"])
    logging.info("We are in the fn line 1")
    qAccesKey = "0657963f91c2cee472772a9e0829a5d37b3f303025acd176a077aa4de8fddfeb496e409e0221a1fc8b5ed75eef435efd974ba2811e5c69380422e5adab61c6eb"
    backendName = 'ibmq_qasm_simulator'
    logging.info("We are in the fn line 2")
    service = QiskitRuntimeService(
    channel='ibm_quantum',
    instance='ibm-q/open/main',
    token='0657963f91c2cee472772a9e0829a5d37b3f303025acd176a077aa4de8fddfeb496e409e0221a1fc8b5ed75eef435efd974ba2811e5c69380422e5adab61c6eb'
)
    logging.info("We are in the fn line 3")
    session = Session(service=service, backend='ibmq_qasm_simulator')

    # run just a single subexperiment
    logging.info("We are in the fn line 4")
    # sampler1 = Sampler(session=session)
    # logging.info("We are in the fn line 5")
    # job1 = sampler1.run(subexp_list[0])
    # logging.info("We are in the fn line 6")
    # job_id = job1.job_id()
    # logging.info("We are in the fn line 7")
    # retval = {
    #     "statusCode": 200,
    #     "body": {
    #             "job_id": job_id,
    #             "time": body["time"]
    #         }
    # }

    sampler = Sampler(session=session)
    logging.info("We are in the fn line 5")
    job_ids=[]
    for subex in subexp_list:
      job = sampler.run(subex)
      logging.info("We are in the fn line 6")
      job_ids.append(job.job_id())
    logging.info("We are in the fn line 7")
    retval = {
        "statusCode": 200,
        "body": {
                "Awaited_job_ids": job_ids,
                "time": body["time"],
                "message":"All quantam jobs are submitted sucessfully"
            }
    }
    print("return value", retval)
    # return retval
    return SerWOObject(body=retval["body"])
  except Exception as e:
    logging.info(e)
    logging.info(e)
    logging.info("Error in Invoke function")
    raise Exception("[SerWOLite-Error]::Error at user function",e)
  


